var game;
var gameLoaded = false;
var createOnLoaded = false;

window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = []

        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        this.bg = this.add.image(0,0,'bg').setOrigin(0,0)

        // downloadBtn.on('pointerdown', function (pointer) {
        //     landingPage();
        // }, this);
        this.arr_word = [
            {
                name:"jack_w",
                x:17,
                y:680,
                falg:true
            },
            {
                name:"titanic_w",
                x:141,
                y:680
            },
            {
                name:"pose_w",
                x:265,
                y:680
            },
            {
                name:"iceberg_w",
                x:389,
                y:680
            },
            {
                name:"sea_w",
                x:17,
                y:740
            },
            {
                name:"rose_w",
                x:141,
                y:740
            },
            {
                name:"cruise_w",
                x:265,
                y:740
            },
            {
                name:"glass_w",
                x:389,
                y:740
            }
        ]

        this.words(this.arr_word)
        this.showHand()


        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    update(){
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        if(this.num1 == 4){
            console.log('ccc')
            this.num1 = 0
            setTimeout(() => {
               this.showDownload(4) 
            }, 500);
            
        }
        if(this.num1+this.num2 == 5&&(this.num2 == 2||this.num2 == 3||this.num2 == 4)){
            console.log('111')
            this.num1 = 0
            this.num2 = 0
            setTimeout(() => {
                this.showDownload(5)
            }, 500);
            
        }

    }

    //引导
    showHand(){
        this.jack = this.add.image(17,680,'jack_g') .setOrigin(0,0)
        this.jack.visible = 0
        this.jack.setDepth(1)
        this.hand = this.add.image(90,720,'hand') 
        this.hand.scaleX = 0.3
        this.hand.scaleY = 0.3
        this.hand.setDepth(1)
        this.tweens.add({
            targets:[this.hand],
            scaleX:0.4,
            scaleY:0.4,
            duration:400,
            callbackScope:this,
            onComplete:()=>{
                this.jack.visible = 0
                this.tweens.add({
                    targets:[this.hand],
                    scaleX:0.3,
                    scaleY:0.3,
                    duration:400,
                    callbackScope:this,
                    onComplete:()=>{
                        this.jack.visible = 1
                    }
                })
            }
        })
        setInterval(() => {
            this.tweens.add({
                targets:[this.hand],
                scaleX:0.4,
                scaleY:0.4,
                duration:400,
                callbackScope:this,
                onComplete:()=>{
                    this.jack.visible = 0
                    this.tweens.add({
                        targets:[this.hand],
                        scaleX:0.3,
                        scaleY:0.3,
                        duration:400,
                        callbackScope:this,
                        onComplete:()=>{
                            this.jack.visible = 1
                        }
                    })
                }
            })
        }, 800);
        this.input.on('pointerdown',()=>{
            this.hand.visible = 0
            this.jack.visible = 0
        },this)
    }

    words(arr_word){
        this.word_name = []
        this.num1 = 0
        this.num2 = 0
        for(var i = 0;i<arr_word.length;i++){ 
          eval( "this." + arr_word[i].name + " = this.add.image(arr_word[i].x,arr_word[i].y,arr_word[i].name).setInteractive().setOrigin(0,0)")
          this.word_name.push(eval( "this." + arr_word[i].name))
        }

        console.log(this.word_name)
        // for(var i = 0; i < this.word_name.length ; i++){
        //     this.word_name[i].on('pointerdown',(pointer)=>{
        //         console.log(this)
        //     })
        // }
        this.jack_w.once('pointerdown',()=>{
            this.jack_g = this.add.image(arr_word[0].x,arr_word[0].y,'jack_g').setOrigin(0,0)
            this.jack_bg = this.add.image(168,175,'jack_bg')
            this.num1++
        },this)
        this.titanic_w.once('pointerdown',()=>{
            this.titanic_g = this.add.image(arr_word[1].x,arr_word[1].y,'titanic_g').setOrigin(0,0)
            this.titanic_bg = this.add.image(167,495,'titanic_bg')

        },this)
        this.pose_w.once('pointerdown',()=>{
            this.num2++
            this.pose_r = this.add.image(arr_word[2].x,arr_word[2].y,'pose_r').setOrigin(0,0)
            this.pose_w.visible = 0
            this.tweens.add({
                targets:[this.pose_r],
                x:this.pose_r.x-10,
                duration:10,
                callbackScope: this,
                onComplete: () => {
                    this.tweens.add({
                        targets:[this.pose_r],
                        y:this.pose_r.y-10,
                        duration:10,
                        callbackScope: this,
                        onComplete: () => {
                            this.tweens.add({
                                targets:[this.pose_r],
                                x:this.pose_r.x+10,
                                y:this.pose_r.y+10,
                                duration:10,
                                callbackScope: this,
                                onComplete: () => {
                                }
                            })
                        }
                    })
                }
            })
        },this)
        this.iceberg_w.once('pointerdown',()=>{
            this.iceberg_g = this.add.image(arr_word[3].x,arr_word[3].y,'iceberg_g').setOrigin(0,0)
            this.iceberg_bg = this.add.image(470,385,'iceberg_bg')
            this.num1++
        },this)
        this.sea_w.once('pointerdown',()=>{
            this.sea_g = this.add.image(arr_word[4].x,arr_word[4].y,'sea_g').setOrigin(0,0)
            this.sea = this.add.image(360,420,'sea_bg')
            this.num1++
        },this)
        this.rose_w.once('pointerdown',()=>{
            this.num2++
            this.rose_r = this.add.image(arr_word[5].x,arr_word[5].y,'rose_r').setOrigin(0,0)
            this.rose_w.visible = 0
            this.tweens.add({
                targets:[this.rose_r],
                x:this.rose_r.x-10,
                duration:10,
                callbackScope: this,
                onComplete: () => {
                    this.tweens.add({
                        targets:[this.rose_r],
                        y:this.rose_r.y-10,
                        duration:10,
                        callbackScope: this,
                        onComplete: () => {
                            this.tweens.add({
                                targets:[this.rose_r],
                                x:this.rose_r.x+10,
                                y:this.rose_r.y+10,
                                duration:10,
                                callbackScope: this,
                                onComplete: () => {
                                }
                            })
                        }
                    })
                }
            })
        },this)
        this.cruise_w.once('pointerdown',()=>{
            this.num2++
            this.cruise_r = this.add.image(arr_word[6].x,arr_word[6].y,'cruise_r').setOrigin(0,0)
            this.cruise_w.visible = 0
            this.tweens.add({
                targets:[this.cruise_r],
                x:this.cruise_r.x-10,
                duration:10,
                callbackScope: this,
                onComplete: () => {
                    this.tweens.add({
                        targets:[this.cruise_r],
                        y:this.cruise_r.y-10,
                        duration:10,
                        callbackScope: this,
                        onComplete: () => {
                            this.tweens.add({
                                targets:[this.cruise_r],
                                x:this.cruise_r.x+10,
                                y:this.cruise_r.y+10,
                                duration:10,
                                callbackScope: this,
                                onComplete: () => {
                                }
                            })
                        }
                    })
                }
            })
        },this)
        this.glass_w.once('pointerdown',()=>{
            this.num2++
            this.glass_r = this.add.image(arr_word[7].x,arr_word[7].y,'glass_r').setOrigin(0,0)
            this.glass_w.visible = 0
            this.tweens.add({
                targets:[this.glass_r],
                x:this.glass_r.x-10,
                duration:10,
                callbackScope: this,
                onComplete: () => {
                    this.tweens.add({
                        targets:[this.glass_r],
                        y:this.glass_r.y-10,
                        duration:10,
                        callbackScope: this,
                        onComplete: () => {
                            this.tweens.add({
                                targets:[this.glass_r],
                                x:this.glass_r.x+10,

                                callbackScope: this,
                                onComplete: () => {
                                }
                            })
                        }
                    })
                }
            })
        },this)
        

    }

    // 下载
    showDownload(n){
        this.tm = this.add.image(0,0,'bg').setOrigin(0,0).setInteractive()
        this.tm.alpha = 0.0001
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics.alpha = 0.85;
        graphics.setDepth(8);
        graphics.fillRectShape(rect);
        if(n == 4){
            this.success = this.add.image(256,400,'success')
            this.success.scaleX = 0
            this.success.scaleY = 0
            this.success.setDepth(9)
            this.tweens.add({
                targets:[this.success],
                scaleX:1,
                scaleY:1,
                duration:400,
                callbackScope: this,
                onComplete: () => {
                    this.continue = this.add.image(256,500,'continue').setInteractive()
                    this.continue.setDepth(9)
                    this.continue.on('pointerdown',()=>{
                        landingPage()
                    },this)
                }
            })
        }
        if(n == 5){
            this.fail = this.add.image(256,400,'fail')
            this.fail.scaleX = 0
            this.fail.scaleY = 0
            this.fail.setDepth(9)
            this.tweens.add({
                targets:[this.fail],
                scaleX:1,
                scaleY:1,
                duration:400,
                callbackScope: this,
                onComplete: () => {
                    this.download = this.add.image(186,500,'download').setInteractive()
                    this.repty = this.add.image(326,500,'repty').setInteractive()
                    this.download.setDepth(9)
                    this.repty.setDepth(9)
                    this.download.on('pointerdown',()=>{
                        landingPage()
                    },this)
                    this.repty.on('pointerdown',()=>{
                        this.scene.start("PlayGame")
                    },this)
                }
            })
        }

    }

    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
}
